import { Box, grid } from "@mui/system";
import React from "react";

import {
  AppBar,
  Button,
  IconButton,
  Toolbar,
  Typography,
  Link,
} from "@mui/material";
import MenuIcon from '@mui/icons-material/Menu';

const Navigation = (props) => {
  return (
    <grid>
      {props.isLoggedIn && <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
            </IconButton>
            <Typography>Menu</Typography>
            <Button onClick={props.onLogou} >Logout</Button>
          </Toolbar>

        </AppBar>
      </Box>}
    </grid>
  );
};

export default Navigation;
